import React, { useState, useEffect } from 'react';
import axios from 'axios';
import ExerciseGraph from './ExerciseGraph'; // Import your ExerciseGraph component

function TrackExercise() {
  const [exerciseData, setExerciseData] = useState([]);
  // ...

  const handleTrackExercise = async () => {
    // Perform exercise tracking and update the backend

    // Fetch updated exercise data after tracking
    try {
      const response = await axios.get('http://localhost:8000/api/exercises/'); // Replace with your backend API URL
      const updatedExerciseData = response.data;

      // Update the state with the updated exercise data
      setExerciseData(updatedExerciseData);
    } catch (error) {
      console.error('Error fetching updated exercise data:', error);
    }
  };

  return (
    <div>
      {/* Your exercise tracking form here */}
      <button onClick={handleTrackExercise}>Track Exercise</button>

      {/* Pass updated exerciseData to the ExerciseGraph component */}
      <ExerciseGraph exerciseData={exerciseData} />
    </div>
  );
}

export default TrackExercise;
